import React from "react";

class Header extends React.Component {
  render() {
    return (
      <div className="header">
        <div className="grid">
          <div className="start">
            <a href="/">
              Home
              <img src="" alt="" />
              <span>蕨鹿逢生</span>
            </a>
          </div>
          <div className="end">
            <a href="/">Login</a>
            <a href="/">Register</a>
            <a href="/">ShoppingCart</a>
            <span className="nickname">{this.props.nickname}</span>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
